import React,{ useState } from "react";
import './allStyles/styles.css';

export const Register = (props) => {
    const [email, setEmail] = useState('');
    const [pass, setPass] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log(email);
    }

    return (
        <div className = "main-container">
        {/* <div className="side-container"></div> */}
        <div>
        <div className="internal-up">Virtual-Vibe</div>
        <div className="internal-container">
        <h2>Register</h2>
        <form className="registerForm" onSubmit = {handleSubmit}>
            <label htmlFor="email">email</label>
            <input value={email} onChange={(e) => setEmail(e.target.value)}type="email" placeholder="youremail@gmail.com" id="email" name="email" />
            <label htmlFor="password">password</label>
            <input value={pass} onChange={(e) => setPass(e.target.value)} type="password" placeholder="********" id="password" name="password" />
            <button className="button1" type="submit">Register</button>
        </form>
        <button className="toggleButton" onClick={() => props.onFormSwitch('login')}>Already have an account? Login here</button>
        </div>
        </div>
        </div>
    )
}
